import React from "react";
import MenuIcon from "@mui/icons-material/Menu";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="logo">Hiring Needs</div>
      <div className="menu">
        <div className="mobile-menu">
          <MenuIcon />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
